import{_ as t,c as a,o,U as e}from"./chunks/framework.K-r7inPk.js";const q=JSON.parse('{"title":"管理员 – 职位管理页面 增加复制职位功能","description":"","frontmatter":{"title":"管理员 &#8211; 职位管理页面 增加复制职位功能","date":"2020-10-09T11:53:17.000Z"},"headers":[],"relativePath":"doc/wpdoc/管理员职位管理页面 增加复制职位功能.md","filePath":"doc/wpdoc/管理员职位管理页面 增加复制职位功能.md"}'),p={name:"doc/wpdoc/管理员职位管理页面 增加复制职位功能.md"},r=e('<h1 id="管理员-职位管理页面-增加复制职位功能" tabindex="-1">管理员 - 职位管理页面 增加复制职位功能 <a class="header-anchor" href="#管理员-职位管理页面-增加复制职位功能" aria-label="Permalink to &quot;管理员 - 职位管理页面 增加复制职位功能&quot;">​</a></h1><p>管理员登录 -&gt; 职位管理 -&gt; 新增复制职位功能，勾选职位信息，点击复制，填入新的职位名称，将勾选职位信息“完整”的复制一份。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/copyposition1.png" alt=""></p><h3 id="版本要求" tabindex="-1">版本要求 <a class="header-anchor" href="#版本要求" aria-label="Permalink to &quot;版本要求&quot;">​</a></h3><ul><li>web端引擎包(V9.2.0+)</li><li>aPaaS后台服务(2.9+)</li><li>产品版本(V8.5.1-base)</li></ul><h3 id="配置方式" tabindex="-1">配置方式 <a class="header-anchor" href="#配置方式" aria-label="Permalink to &quot;配置方式&quot;">​</a></h3><p>该功能为个性化功能，默认不开启，如需要，配置方式如下：</p><p>1、确认要配置的项目符合版本要求。<br> 2、下载业务行为<a href="http://apaas.wxchina.com:8881/wp-content/uploads/%E4%B8%9A%E5%8A%A1%E8%A1%8C%E4%B8%BA-%E8%81%8C%E4%BD%8D%E5%A4%8D%E5%88%B6.zip" target="_blank" rel="noreferrer">【业务行为-职位复制】</a>，在业务领域中导入，导入后，搜索&quot;职位复制&quot;接口，确保接口存在，则导入成功。<br> 3、下载业务UI<a href="http://apaas.wxchina.com:8881/wp-content/uploads/%E4%B8%9A%E5%8A%A1UI-%E8%81%8C%E4%BD%8D%E7%AE%A1%E7%90%86plus.zip" target="_blank" rel="noreferrer">【业务UI-职位管理plus】</a>，在业务UI中导入，导入后，搜索&quot;职位管理plus&quot;，打开该页面查看协议，在&quot;positionmanagerplus&quot;二开控件的协议中查看是否有属性&quot;copyposition&quot;: &quot;1&quot;，有则说明导入成功，并且，打开该表单右下角的“功能点管理”，查看是否有功能点code为&quot;1292738515473403996&quot;的复制职位功能点，有则说明导入功能点成功。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/copyposition3.png" alt=""></p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/copy.png" alt=""></p><p>4、在IDE上进入关联功能页(配置管理-功能配置-勾选全产品包(无AI)-SFA-打开关联功能)，找到&quot;管理员默认权限(平台)&quot;菜单，关联&quot;复制职位&quot;功能点。<br> 5、刷新页面，即可看到&quot;职位复制&quot;功能按钮。<br> 6、如果想配置成为功能点，由实施自行配置(与普通页面功能点的配置方式一致)。</p>',11),c=[r];function n(i,s,_,l,u,d){return o(),a("div",null,c)}const m=t(p,[["render",n]]);export{q as __pageData,m as default};
